import React from "react";
import slider1 from "../assests/slider1.jpg";

function SectionA(props) {
  return (
    <div>
      <div>
        <Typography>LET'S CHANGE HOW AND WHY YOU WORK</Typography>
      </div>
      <div>
        <img src={slider1} height="500px" width="50%" alt="" />
      </div>
    </div>
  );
}

export default SectionA;
